import React, { useEffect, useState } from 'react';
import Navbar from '../AdminNavbar/AdminNavbar';
import { fetchAllUsers } from '../../../api/Api.js';
// import { DataGrid } from '@mui/x-data-grid';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';





const AdminDashboard = () => {

    const [data, setData] = useState([]);


    const fetchallusers = async () => {
        const responce = await fetchAllUsers();
        // console.log(responce);
        console.log(responce.data);
        const allUsers = responce.data;
        setData({ allUsers });
        // console.log(data);
    }

    useEffect(() => {
        fetchallusers();
    }, []);

    console.log("data ", data);



    return (
        <>
            <Navbar />
            <h3>Admin Dashboard</h3>




            <Grid container justify="space-between" spacing={2} style={{ padding: '30px', width: "100%", marginBottom: 'none', backgroundColor: "#7900FF" }} >
                <Grid item xs={4}>
                    <Card sx={{ maxWidth: 345 }}>
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="div">
                                Lizard
                            </Typography>
                            <Typography variant="body2" color="text.secondary">
                                Lizards are a widespread group of squamate reptiles, with over 6,000
                                species, ranging across all continents except Antarctica
                            </Typography>
                        </CardContent>
                        
                    </Card>
                </Grid>
                <Grid item xs={4}>
                <Card sx={{ maxWidth: 345 }}>
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="div">
                                Lizard
                            </Typography>
                            <Typography variant="body2" color="text.secondary">
                                Lizards are a widespread group of squamate reptiles, with over 6,000
                                species, ranging across all continents except Antarctica
                            </Typography>
                        </CardContent>
                        
                    </Card>
                </Grid>
                <Grid item xs={4}>
                <Card sx={{ maxWidth: 345 }}>
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="div">
                                Lizard
                            </Typography>
                            <Typography variant="body2" color="text.secondary">
                                Lizards are a widespread group of squamate reptiles, with over 6,000
                                species, ranging across all continents except Antarctica
                            </Typography>
                        </CardContent>
                        
                    </Card>
                </Grid>
            </Grid>



        </>
    )
}

export default AdminDashboard;
